import { createAppContainer } from 'react-navigation';
import { createStackNavigator } from 'react-navigation-stack';
import HomeScreen from "./src/screens/HomeScreen";
import category from "./src/screens/category";
import Order from "./src/screens/Order";
import Map from "./src/screens/Map";
import showOrder from "./src/screens/showOrder";
import SingUp from "./src/screens/SingUp";

import { Ionicons } from "@expo/vector-icons";
import React, { Component } from "react";
import { SafeAreaView, Picker, Text, StyleSheet, View, TextInput, Image, Button, ScrollView, ImageBackground } from "react-native";

import Homes from "./src/screens/Homes";

const navigator = createStackNavigator(
  {
    Home: HomeScreen,
    showOrder:showOrder,
    category:category,
    Map:Map,
    Order,Order,
    SingUp :SingUp,
    Homes:Homes ,
  },
  {
    initialRouteName: "Home",

    defaultNavigationOptions: {
      title: " H Maintenace -Qatar ",
      headerStyle: { 
      backgroundColor: '#fff', 
      borderBottomColor: '#000',
      borderBottomWidth: 0 ,   


      elevation: 0,
      shadowOpacity: 0,
      borderBottomWidth: 0},

      headerTitleStyle: { color: '#000', fontSize: 20, fontWeight: '200', textAlign: 'center', alignSelf: 'center',shadowOpacity: 0 },

    }
  }
);

export default createAppContainer(navigator);
